      niceToHave: '<p><strong>b. Working place:</strong> 42B Ho Ba Phan Street, Phuoc Long A Ward, District 9, Ho Chi Minh city.<br></p>\n<p><strong>c. Working hours: </strong>9:00 - 18:00 Monday to Friday.</p>\n<p></p>\n<img src="https://data-gcdn.basecdn.net/202002/sys1002/api/13/12/96/0d/2e/ae/70/514d07fb89f40ba5bbb6b85b0fbdf4e5/d9630743ab49ed4e67fdd1f4b9b3a3a1_352594_QJCJVCABPP8RQ.jpg" alt="" style="height: ;width: "/>\n',
