      responsibilities: '<h2><span style="color: rgb(21,188,197);font-size: 16px;"><strong>2. RESPONSIBILITIES</strong></span></h2>\n<p>We are looking for an experienced and versatile, <strong>product minded Full Stack Software Developer</strong> to join our founding team in Singapore. The role is an unique opportunity to be a pioneer in building an Asia focus treasury solution. You will be taking up a leading role to:</p>\n<ul>\n<li>Apply your expertise an take a leading role in shape the company’s technology direction.</li>\n<li>Take ownership of the Brdgx’s technology development roadmap to develop our product, helping businesses to make their international transfers faster, easier and cheaper (this covers: banking; payment processing; verification; compliance)</li>\n<li>Integrate payment methods and partners, creating a scalable and automated payments engine</li>\n<li>Cover the security aspects of the solution.</li>\n</ul>\n<p><strong>Key Responsibilities</strong></p>\n<ul>\n<li>Responsible for developing application using Java related technologies.</li>\n<li>Support business user for new enhancement or issues. </li>\n<li>Design solutions, including defining and interpreting feature requests, documenting those requests in functional specifications, and designing specific product and features for stability, usability, and maintainability.</li>\n<li>Collaborate with business teams to clarify requirements and business needs.</li>\n<li>Develop system applications to organization’s coding standards and quality.&nbsp;</li>\n</ul>\n',
      requirement: '<h2><span style="color: rgb(21,188,197);background-color: rgb(255,255,255);font-size: 16px;font-family: Muli;"><strong>3. REQUIREMENT</strong></span></h2>\n<ul>\n<li>A Bachelor’s degree in Computer Science.</li>\n<li>5+ years of software development experience.</li>\n<li>3+ years of Java web application.</li>\n<li>Experienced with cloud technology; develop application running on AWS, Azure.</li>\n<li>Microservices, distributed architectures.</li>\n<li>Source Code control e.g. Git.</li>\n<li>Strong experience in agile methodologies and test driven development.</li>\n<li>Good working knowledge of Linux.</li>\n<li>Experience with some of the following:</li>\n</ul>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;+ ReactJS, Typescript, Javascript, HTML, CSS</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;+ Spring Framework, SpringBoot</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;+ MySQL, MongoDB</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;+ Linux</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;+ Docker&nbsp;</p>\n',
      niceToHave: '<p><strong>* Nice to have</strong></p>\n<ul>\n<li>Experience in developing service based application.</li>\n<li>Experience in developing mission critical, scalable and high transaction volume application. </li>\n<li>Excellent analytical skills. </li>\n<li>Fluency in written and spoken English; Good communication and interpersonal skills.</li>\n<li>Self-starter who sets and meets challenging personal targets. &nbsp;</li>\n</ul>\n',
      benefit: '<p><span style="color: rgb(21,188,197);font-size: 16px;"><strong>4. WHY YOU‘LL LOVE WORKING HERE</strong></span></p>\n<p>Attractive salary and annual salary review.</p>\n<ul>\n<li>Working in a professional, friendly, well-equipped environment both with foreigners and Vietnamese.</li>\n<li>Extensive on job training, you will always have a chance to work with new emerging technologies.</li>\n<li>Full social insurance, health insurance &amp; unemployment insurance according to Vietnam Labor Law.</li>\n<li>12-day annual leave per year.</li>\n<li>13th month salary.</li>\n<li>PVI Health Care.</li>\n<li>Enjoy diversified activities: Free snack, Weekly and Monthly Team-building, Company trip, Play Game (PlayStation, Board games), Play Sport (Football, Badminton...)<br>&nbsp;</li>\n</ul>\n',
